;(()=>{ 
  const REMOVE_HEADINGS = new Set(["Contributors","Translators"]);
  const SOCIAL_HOSTS = ["github.com","twitter.com","x.com","discord.gg","t.me","youtube.com","youtu.be","facebook.com","instagram.com","patreon.com","opencollective.com","ko-fi.com","kofi.com"];
  function isSocialLink(a){
    try{
      const u=new URL(a.href);
      return SOCIAL_HOSTS.some(h=>u.hostname===h || u.hostname.endsWith("."+h));
    }catch(e){return false;}
  }
  function removeContributorsAndRelated(){
    // Remove social icon row (a group of external links/icons)
    const anchors=[...document.querySelectorAll('a[href]')];
    for(const a of anchors){
      if(!isSocialLink(a)) continue;
      const parent=a.closest('div');
      if(parent && parent.querySelectorAll('a[href]').length>=3){
        parent.remove();
      }
    }

    // Remove Contributors/Translators sections by heading text
    const headings=[...document.querySelectorAll('h1,h2,h3,p,div,span')];
    for(const el of headings){
      const t=(el.textContent||"").trim();
      if(!REMOVE_HEADINGS.has(t)) continue;

      // Try to find a section container that includes this heading and (optionally) avatar grid.
      let container = el.closest('section') || el.parentElement;
      let steps=0;
      while(container && steps<10){
        const txt=(container.textContent||"");
        if(txt.includes(t)){
          // Prefer a container that looks like the whole block (heading + content)
          const hasManyImgs = container.querySelectorAll('img').length >= 5;
          const hasNextHeading = [...container.querySelectorAll('h1,h2,h3')].some(h=>{
            const ht=(h.textContent||"").trim();
            return ht!==t && REMOVE_HEADINGS.has(ht);
          });
          // If this container is too small (only the heading), walk up.
          if(container.children && container.children.length<=1) {
            container = container.parentElement; steps++; continue;
          }
          // Remove the whole container block.
          container.remove();
          break;
        }
        container = container.parentElement;
        steps++;
      }
    }
  }

  // Run now + keep watching for SPA route changes
  const run = ()=>{ try{ removeContributorsAndRelated(); }catch(e){} };
  if(document.readyState==="loading"){
    document.addEventListener("DOMContentLoaded", run, {once:true});
  } else {
    run();
  }
  const obs = new MutationObserver(()=>run());
  obs.observe(document.documentElement, {subtree:true, childList:true});
})(); 
